INSERT INTO `faq_questions` (`nid`, `vid`, `question`, `detailed_question`) VALUES
(22, 22, 'Deleniti quisquam voluptatem do nascetur ?', 'Curae mollit aliquip pellentesque alias ullamco, vel, veniam per pellentesque, animi curae'),
(23, 23, 'Expedita, iure erat impedit duis, mattis ?', 'Eget natus aliquip aute nascetur, odit itaque iure massa aliquid id rem aliqua, voluptatibus vestibulum facilisis, adipiscing, non sociis beatae'),
(24, 24, 'Voluptatibus, officia vitae, nulla pede vestibulum ?', 'Nonummy lacinia eaque irure tempore animi. Semper dolorum libero illum, lacus quod. Ac! Conubia aliquip amet molestias tenetur, venenatis'),
(25, 25, 'Pretium posuere illo montes nullam, corporis ?', 'lorem ducimus erat, rem, nonummy porta? Minus quisque quibusdam'),
(37, 37, 'Corporis distinctio feugiat sollicitudin quos lobortis ?', 'Repellendus magna, occaecat dignissim. Cupidatat diam autem dignissim! Tincidunt convallis rem augue! Reiciendis risus nulla laboriosam consequatur nec cumque nihil cupiditate, aliquip nulla potenti aperiam nonummy illum, gravida cillum metus! Molestias posuere adipisicing iusto nam turpis'),
(38, 38, 'Maiores fugit suscipit velit veritatis illum culpa morbi ?', 'Maiores fugit suscipit velit veritatis illum culpa morbi mollis alias. Quod harum reiciendis perferendis egestas, eleifend taciti aute mollitia aptent dicta cupiditate etiam? Maxime, optio malesuada, explicabo! Itaque dignissimos nec? Occaecati labore tempora purus'),
(39, 39, 'Sequi cras curabitur magni neque, consequatur ?', 'Sequi cras curabitur magni neque, consequatur! Sodales curabitur? Lorem inceptos posuere dicta. Nostra? Ea imperdiet tortor? Magnis doloribus cumque cras pede adipisicing eaque mollitia aspernatur quo, repellat hymenaeos delectus mus saepe! '),
(40, 40, 'Cras dolorem unde qui, tempora senectus corporis ?', 'Cras dolorem unde qui, tempora senectus corporis elementum praesentium conubia dictumst eius, condimentum penatibus incidunt dictumst purus felis irure occaecati fugit eu cursus praesentium imperdiet corrupti. Dapibus cillum. Faucibus habitasse esse voluptas aliquam?'),
