INSERT INTO `field_revision_field_specifications` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_specifications_value`, `field_specifications_summary`, `field_specifications_format`) VALUES
('node', 'product', 0, 7, 7, 'und', 0, '<h3>Product Features</h3>\r\n<ul>\r\n	<li>9.7 Retina Display; 2048 x 1536 Resolution</li>\r\n	<li>Apple iOS 5; Dual-Core A5X Chip with Quad-Core Graphics</li>\r\n	<li>5 Megapixel iSight Camera; 1080p Video Recording</li>\r\n	<li>Wi-Fi (802.11a/b/g/n); 64 GB Capacity</li>\r\n	<li>Up to 10 Hours of Battery Life; 1.44 lbs</li>\r\n</ul>\r\n<p><strong>Processor, Memory, and Motherboard</strong></p>\r\n<ul>\r\n	<li>Hardware Platform: XXX</li>\r\n	<li>Processor: 1 GHz A5X</li>\r\n	<li>RAM: 1 GB</li>\r\n	<li>RAM Type: SIMM</li>\r\n</ul>\r\n<p><strong>Hard Drive</strong></p>\r\n<ul>\r\n	<li>Type: Solid State</li>\r\n</ul>\r\n<p><strong>Cases and Expandability</strong></p>\r\n<ul>\r\n	<li>Size (LWH): 9.5 inches, 7.31 inches, 0.37 inches</li>\r\n	<li>Weight: 1.44 pounds</li>\r\n</ul>\r\n<p><strong>Power</strong></p>\r\n<ul>\r\n	<li>Rated Charge (normal use): 10 hours</li>\r\n</ul>\r\n', '', 'filtered_html'),
('node', 'product', 0, 9, 9, 'und', 0, '<p style="font-weight: bold; margin-bottom: 5px;">Processor, Memory, and Motherboard</p>\r\n<ul style="padding-left: 10px;">\r\n	<li><b>Hardware Platform:</b> PC</li>\r\n	<li><b>Processor:</b> 2.5 GHz Intel Core i5</li>\r\n	<li><b>Number of Processors:</b> 2</li>\r\n	<li><b>RAM:</b> 4 GB</li>\r\n</ul>\r\n<p style="font-weight: bold; margin-bottom: 5px;">Hard Drive</p>\r\n<ul style="padding-left: 10px;">\r\n	<li><b>Size:</b> 320 GB</li>\r\n	<li><b>Type:</b> Serial ATA</li>\r\n	<li><b>Speed:</b> 7200 rpm</li>\r\n	<li><b>Additional Drives:</b> DVD-RW</li>\r\n</ul>\r\n<p style="font-weight: bold; margin-bottom: 5px;">Graphics and Display</p>\r\n<ul style="padding-left: 10px;">\r\n	<li><b>Graphics Card:</b> HD Graphics</li>\r\n	<li><b>Graphics RAM:</b> 2520 MB</li>\r\n	<li><b>Interface:</b> Integrated</li>\r\n	<li><b>LCD Native Resolution:</b> 1366 x 768</li>\r\n</ul>\r\n<p style="font-weight: bold; margin-bottom: 5px;">Ports and Connectivity</p>\r\n<ul style="padding-left: 10px;">\r\n	<li><b>USB Ports:</b> 2</li>\r\n	<li><b>USB 2.0 Ports:</b> 1</li>\r\n</ul>\r\n<p style="font-weight: bold; margin-bottom: 5px;">Cases and Expandability</p>\r\n<ul style="padding-left: 10px;">\r\n	<li><b>Size (LWH):</b> 9.1 inches, 13.26 inches, 0.84 inches</li>\r\n	<li><b>Weight:</b> 6.8 pounds</li>\r\n</ul>\r\n<p style="font-weight: bold; margin-bottom: 5px;">Power</p>\r\n<ul style="padding-left: 10px;">\r\n	<li><b>Rated Charge (standby):</b> 5.2 hours</li>\r\n</ul>\r\n<p style="font-weight: bold; margin-bottom: 5px;">Wireless</p>\r\n<ul style="padding-left: 10px;">\r\n	<li><b>Wireless Type:</b> 802.11n</li>\r\n</ul>\r\n', '', 'full_html'),
('node', 'product', 0, 14, 14, 'und', 0, '<ul>\r\n	<li><strong>13.3-inch LED-backlit glossy widescreen display</strong>&nbsp;with edge-to-edge, uninterrupted glass (1280 x 800-pixel resolution)</li>\r\n	<li><strong>2.5 GHz Intel Core i5 dual-core processor</strong>&nbsp;(3.1 GHz with Turbo Boost Technology; 3 MB L3 cache)</li>\r\n	<li><strong>Intel HD Graphics 4000 integrated graphics processor</strong></li>\r\n	<li><strong>500 GB Serial ATA hard drive</strong>&nbsp;(5400 RPM)</li>\r\n	<li><strong>4 GB installed RAM</strong>&nbsp;(1600 MHz DDR3; supports up to 8 GB)</li>\r\n	<li><strong>8x slot-loading SuperDrive&nbsp;</strong>with double-layer DVD support (DVD&plusmn;R DL/DVD&plusmn;RW/CD-RW)</li>\r\n	<li><strong>Built-in HD 720p FaceTime HD camera&nbsp;for video chatting</strong></li>\r\n	<li><strong>Wi-Fi wireless networking</strong>&nbsp;(based on 802.11n specification; 802.11a/b/g compatible)</li>\r\n	<li><strong>Gigabit Ethernet wired networking</strong>&nbsp;(10/100/1000)</li>\r\n	<li><strong>Bluetooth 4.0&nbsp;for connecting with peripherals such as keyboards, mice and cell phones</strong></li>\r\n	<li><strong>Thunderbolt port</strong>&nbsp;(up to 10 Gbps) with native video output support for Mini DisplayPort plus DVI, VGA, dual-link DVI, and HDMI (requires adapters, sold separately)</li>\r\n	<li><strong>Two USB 3 ports</strong>&nbsp;(up to 5 Gbps; backwards compatibility with USB 2)</li>\r\n	<li><strong>FireWire 800 port&nbsp;</strong>(up to 800 Mbps)</li>\r\n	<li><strong>SDXC card slot</strong>&nbsp;(supports cards up to 64 GB in size)</li>\r\n	<li><strong>Stereo speakers with subwoofers</strong></li>\r\n	<li><strong>Combined audio line in/out</strong>&nbsp;(digital/analog)</li>\r\n	<li><strong>Dimensions:&nbsp;12.78 x 8.94 x 0.95 inches</strong> (WxDxH)</li>\r\n	<li><strong>Weight</strong>:&nbsp;4.5 pounds</li>\r\n	<li><strong>Up to 7 hours of battery life</strong></li>\r\n</ul>\r\n', '', 'filtered_html'),
('node', 'product', 0, 15, 15, 'und', 0, '<ul>\r\n	<li><strong>15-inch LED-backlit glossy widescreen display</strong>&nbsp;with edge-to-edge, uninterrupted glass (1280 x 800-pixel resolution)</li>\r\n	<li><strong>2.5 GHz Intel Core i5 dual-core processor</strong>&nbsp;(3.1 GHz with Turbo Boost Technology; 3 MB L3 cache)</li>\r\n	<li><strong>Intel HD Graphics 4000 integrated graphics processor</strong></li>\r\n	<li><strong>500 GB Serial ATA hard drive</strong>&nbsp;(5400 RPM)</li>\r\n	<li><strong>4 GB installed RAM</strong>&nbsp;(1600 MHz DDR3; supports up to 8 GB)</li>\r\n	<li><strong>8x slot-loading SuperDrive&nbsp;</strong>with double-layer DVD support (DVD&plusmn;R DL/DVD&plusmn;RW/CD-RW)</li>\r\n	<li><strong>Built-in HD 720p FaceTime HD camera&nbsp;for video chatting</strong></li>\r\n	<li><strong>Wi-Fi wireless networking</strong>&nbsp;(based on 802.11n specification; 802.11a/b/g compatible)</li>\r\n	<li><strong>Gigabit Ethernet wired networking</strong>&nbsp;(10/100/1000)</li>\r\n	<li><strong>Bluetooth 4.0&nbsp;for connecting with peripherals such as keyboards, mice and cell phones</strong></li>\r\n	<li><strong>Thunderbolt port</strong>&nbsp;(up to 10 Gbps) with native video output support for Mini DisplayPort plus DVI, VGA, dual-link DVI, and HDMI (requires adapters, sold separately)</li>\r\n	<li><strong>Two USB 3 ports</strong>&nbsp;(up to 5 Gbps; backwards compatibility with USB 2)</li>\r\n	<li><strong>FireWire 800 port&nbsp;</strong>(up to 800 Mbps)</li>\r\n	<li><strong>SDXC card slot</strong>&nbsp;(supports cards up to 64 GB in size)</li>\r\n	<li><strong>Stereo speakers with subwoofers</strong></li>\r\n	<li><strong>Combined audio line in/out</strong>&nbsp;(digital/analog)</li>\r\n	<li><strong>Dimensions:&nbsp;12.78 x 8.94 x 0.95 inches</strong> (WxDxH)</li>\r\n	<li><strong>Weight</strong>:&nbsp;4.5 pounds</li>\r\n	<li><strong>Up to 7 hours of battery life</strong></li>\r\n</ul>\r\n', '', 'filtered_html'),
